void ADC0_Init(void)
{	
	
// Enable the port clock for the pin that we will be using for the ADC input:

	SYSCTL_RCGC_GPIO_R |=  CLOCK_GPIOE;   		// clock to Port E* (p 340)
	SYSCTL_RCGC_ADC_R |= ADC0_CLOCK_ENABLE;   // ADC0, (p 652)  (P 817 says do this first, examples do port first
	
	Delay(5);
	GPIO_PORTE_AFSEL_R |= (GPIO_PIN2_ENABLE);	// (p 671), want the alternate function
  GPIO_PORTE_DEN_R &= ~(GPIO_PIN2_ENABLE);	// Cleraing, do NOT want digital for A2D  (p 683)
	GPIO_PORTE_AMSEL_R |= GPIO_PIN2_ENABLE;		// select analog mode (p 687)
	GPIO_PORTE_DIR_R &= ~GPIO_PIN2_ENABLE;			// input (analog probably implies input?)


	ADC0_ISC_R = ADC0_SS3_BIT;         				// clear status flag-- can now access ADC regs w/out fault							
	ADC0_ACTIVE_SS_R &= ~0x0F;								// disable all sample sequencesrs (#3 should be enough-p 821)
	
	while(ADC0_ACTIVE_SS_R & 0x00010000)     	// wait for not busy?  -- should fall through right away
	{};  																			// should have #defined busy flag for readability

	ADC0_EMUX_R &= (~0xF000);									 // EM3 = 0000 -> software trigger
//////////////////////////	
// Select AN1 (PE2) as the analog input (Table 23-3, p 1337
ADC0_SS3_IN_MUX_R = 0x01;  //PE2
// ADC0_SS3_IN_MUX_R |= 0x01;
		/////////////
		//////////
		//////////
		/////////
// 1st sample is end of sequence (so we're done after 1)
	ADC0_SS3_CONTROL_R |= 0x06;	// p 876 (need to set bit to poll on), so 0110 not 0010?
	
//Should wake up @ 0x7-> 1Msps   Just leave for now?
		ADC0_PERI_CONFIG_R = 0x03;						// 250 Ksps (p 891) 

	// 16x oversampling and then averaged
	ADC0_SAMPLE_AVE_R |= 0x04;
	
	// Configure (re-anable) ADC0 module for sequencer 3
	ADC0_ACTIVE_SS_R = 0x00000008;	
	
	return;

}

void ADC1_Init(void)
{	
	
// Enable the port clock for the pin that we will be using for the ADC input:

	SYSCTL_RCGC_GPIO_R |=  CLOCK_GPIOE;   		// clock to Port E* (p 340)
	SYSCTL_RCGC_ADC_R |= ADC1_CLOCK_ENABLE;   // ADC0, (p 652)  (P 817 says do this first, examples do port first
	
	Delay(5);
	GPIO_PORTE_AFSEL_R |= (GPIO_PIN3_ENABLE);	// (p 671), want the alternate function
  GPIO_PORTE_DEN_R &= ~(GPIO_PIN3_ENABLE);	// Cleraing, do NOT want digital for A2D  (p 683)
	GPIO_PORTE_AMSEL_R |= GPIO_PIN3_ENABLE;		// select analog mode (p 687)
	GPIO_PORTE_DIR_R &= ~GPIO_PIN3_ENABLE;			// input (analog probably implies input?)


	ADC1_ISC_R = ADC1_SS3_BIT;         				// clear status flag-- can now access ADC regs w/out fault							
	ADC1_ACTIVE_SS_R &= ~0x0F;								// disable all sample sequencesrs (#3 should be enough-p 821)
	
	while(ADC1_ACTIVE_SS_R & 0x00010000)     	// wait for not busy?  -- should fall through right away
	{};  																			// should have #defined busy flag for readability

	ADC1_EMUX_R &= (~0xF000);									 // EM3 = 0000 -> software trigger
//////////////////////////	
// Select AN1 (PE2) as the analog input (Table 23-3, p 1337
	ADC1_SS3_IN_MUX_R = 0x0;  //PIN E 3
	//ADC0_SS3_IN_MUX_R |= 0x01;
		/////////////
		//////////
		//////////
		/////////
// 1st sample is end of sequence (so we're done after 1)
	ADC1_SS3_CONTROL_R |= 0x06;	// p 876 (need to set bit to poll on), so 0110 not 0010?
	
//Should wake up @ 0x7-> 1Msps   Just leave for now?
		ADC1_PERI_CONFIG_R = 0x03;						// 250 Ksps (p 891) 

	// 16x oversampling and then averaged
	ADC1_SAMPLE_AVE_R |= 0x04;
	
	// Configure (re-anable) ADC0 module for sequencer 3
	ADC1_ACTIVE_SS_R = 0x00000008;	
	
	return;

}

